import React, { useState } from "react";

import Button from "@material-ui/core/Button";
import ATextField from "./aTextField";
import ASearch from "./aSearch";

const TestContentPanel3 = (props) => {
  const columnDefs = [
    {
      headerName: "ID",
      field: "id",
      sortable: true,
      sortOrder: "asc",
      filter: true,
      checkbox: true,
    },
    {
      headerName: "First Name",
      field: "firstName",
      sortable: true,
      sortOrder: "desc",
    },
    { headerName: "Last Name", field: "lastName", filter: true },
    { headerName: "Address", field: "address", radio: true },
    { headerName: "Country", field: "country", filter },
    { headerName: "Phone", field: "phone" },
    { headerName: "Email Address", field: "email", filter: true },
  ];

  return (
    <ASearch columnDefs={columnDefs} service="/customers" >
      <ATextField name="search" />
    </ASearch>
  );
};
export default TestContentPanel3;
